import React, { useState } from "react";
import { NavLink } from "react-router-dom";
import "./signup.css";

const SignUp = () => {
  const [fname, setFname] = useState("");
  const [lname, setLname] = useState("");
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [fnameErr, setFnameErr] = useState(false);
  const [lnameErr, setLnameErr] = useState(false);
  const [userameErr, setUsernameErr] = useState(false);
  const [emailErr, setEmailErr] = useState(false);
  const [passErr, setPassErr] = useState(false);
  const [cmfPassErr, setCmfPassErr] = useState(false);

  const formHandler = (e) => {
    let item = e.target.value;
    if (item.length < 3) {
      setFnameErr(true);
      document.getElementById('name').style.border = "2px solid red";
    }
    if (item.length < 3) {
      setLnameErr(true);
      document.getElementById('name').style.border = "2px solid red";
    }
    if (item.length < 3) {
      setUsernameErr(true);
      document.getElementById('name').style.border = "2px solid red";
    }
    if (item.length < 3) {
      setEmailErr(true);
      document.getElementById('name').style.border = "2px solid red";
    }
    if (item.length < 3) {
      setPassErr(true);
      document.getElementById('name').style.border = "2px solid red";
    }
    if (item.length < 3) {
      setCmfPassErr(true);
      document.getElementById('name').style.border = "2px solid red";
    }
     else {
      setFnameErr(false);
      setLnameErr(false);
      setUsername(false);
      setEmailErr(false);
      setPassErr(false);
      setCmfPassErr(false);
      document.getElementById('name').style.border = "none";
    }
    setFname(item);
    setLname(item);
    set(item);
    setFname(item);
    setFname(item);
    setFname(item);
    e.preventDefault();
  };

  const nameHandler = (e) => {
    // let item = e.target.value;
    // if (item.length < 3) {
    //   setFnameErr(true);
    //   document.getElementById('name').style.border = "2px solid red";
    // } else {
    //   setFnameErr(false);
    //   document.getElementById('name').style.border = "none";
    // }
    // setFname(item);
  };

  const userNameHandler = (e) => {};

  const emailHandler = (e) => {};

  const passwordHandler = (e) => {};

  const confirmPasswordHandler = (e) => {};

  return (
    <div className="signup">
      <div className="col-lg-5 col-md-12 col-sm-12">
        <form action="" className="signup_form" onSubmit={formHandler}>
          <div className="row">
            <div className="col-lg-6 col-sm-12 col-12">
              <input
                type="text"
                id="name"
                className="form-control mt-3"
                onChange={nameHandler}
                placeholder="First Name"
              />
            </div>
            <div className="col-lg-6 col-sm-12">
              <input
                type="text"
                id="name"
                className="form-control mt-3"
                onChange={nameHandler}
                placeholder="Last Name"
              />
            </div>
          </div>

          <div className="row">
            <div className="col-lg-6 col-sm-12">
              <input
                type="text"
                id="name"
                className="form-control mt-3"
                onChange={userNameHandler}
                placeholder="UserName"
              />
            </div>
            <div className="col-lg-6 col-sm-12">
              <input
                type="text"
                id="name"
                className="form-control mt-3"
                onChange={emailHandler}
                placeholder="abc@example.com"
              />
            </div>
          </div>

          <div className="row">
            <div className="col-lg-6 col-sm-12">
              <input
                type="password"
                id="name"
                className="form-control mt-3"
                onChange={passwordHandler}
                placeholder="Password"
              />
            </div>
            <div className="col-lg-6 col-sm-12">
              <input
                type="password"
                id="name"
                className="form-control mt-3"
                onChange={confirmPasswordHandler}
                placeholder="Confirm Password"
              />
            </div>
          </div>

          <div className="row">
            <div className="col-lg-12 mt-2">
              <p className="text-danger"> {fnameErr?<span> Invalid Information </span>:""}</p>
            </div>
          </div>

          <div className="row mt-2">
            <div className="col-md-12">
              <button type="submit" className="btn-block signupBtn"> 
                Signup
              </button>
            </div>
            <div className="col-md-12 text-center mt-3">
              <p className="text-dark">
                Already have an Account /
                <NavLink className="loginLink" to="/login">
                  Login
                </NavLink>
              </p>
            </div>
          </div>
        </form>
      </div>
    </div>
  );
};

export default SignUp;
